(1, 'format_1', '<table style=\"margin: 0 auto; max-width: 750px; font-family: \'Arial\', Sans-serif;\" cellpadding=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 50px;\">                <img style=\"width: 92px; height: 90px\" src=\"../img/tc-logo.png\" alt=\"image\" />                        </td>\r\n            <td style=\"text-align: center;\">\r\n                <span style=\"font-size: 25px;font-weight: bold;color: #ec0127\">SRI SHANKARA MATRICULATION HIGHER SECONDARY SCHOOL</span><br/>                \r\n                <span style=\"font-size: 24px\">Thiruvarur Main Road, Peralam - 609 405, Nannilam Tk., Thiruvarur D.T.</span><br/>                \r\n                <div style=\"margin-bottom: 10px;\">                    \r\n                    <span style=\"width: 33.33%; font-size: 18px;margin-right: 40px;\">TMR Code No.: [school_no]</span>\r\n                    <span style=\"width: 33.33%;font-size: 18px;\">Certificate No.: [school_reg_no]</span>\r\n                    <span style=\"width: 33.33%;font-size: 18px;margin-left: 40px;\">Date: [tc_made]</span> \r\n                </div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=\"2\" style=\"padding-top: 10px;\">\r\n                <div style=\"width: 55%; display: inline-block;\">\r\n                    <div style=\"display: inline-block; margin-right: 2px;\"><b>EMIS No.:</b></div>\r\n                    <span style=\"border: 1px solid #000000; width: 20px; height: 20px; text-align: center; display: inline-block;\">[emis1]</span>\r\n                    <span style=\"border: 1px solid #000000; width: 20px; height: 20px; text-align: center; display: inline-block;\">[emis2]</span>\r\n                    <span style=\"border: 1px solid #000000; width: 20px; height: 20px; text-align: center; display: inline-block;\">[emis3]</span>\r\n                    <span style=\"border: 1px solid #000000; width: 20px; height: 20px; text-align: center; display: i