enth / Twelfth</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\"></td>\r\n                        <td width=\"50%\">b. The Course offered, i.e. General or Vocational Education</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[class_words]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\"></td>\r\n                        <td width=\"50%\">c. In the Case of General Education, the subjects offered <br/><span style=\"padding-left: 15px;\"> under part III Group-A & the Medium of Instruction</span></td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[general_education]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\"></td>\r\n                        <td width=\"50%\" style=\"font-size: 14px\">d. In the case of Vocational Education, the Vocational subject under <br/><span style=\"padding-left: 15px;\"> part III Group-B & the related subject offered under part III Group-A</span></td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[vocational_education]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\"></td>\r\n                        <td width=\"50%\">e. Language offered under part - I</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[language_offered]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\"></td>\r\n                        <td width=\"50%\">f. Medium of study</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[medium_study]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\">11.</td>\r\n                        <td width=\"50%\">Whether qualified for promotion to higher standard under Higher Secondary Education rules</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[qualified_higher]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\">12.</td>\r\n                        <td width=\"50%\">Whether the pupil has paid all the fees due to the school</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[due_paid]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\">13.</td>\r\n                        <td width=\"50%\">Whether the pupil was in receipt of any scholarship <span style=\"font-size: 14px;\">(nature of the scholarship to be specified) or any</span> Educational Concessions</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[scholoarship]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\">14.</td>\r\n                        <td width=\"50%\">Whether the pupil has undergone Medical Inspection during the last academic year (First or Repeat to be specified)</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[medical_inspection]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\">15.</td>\r\n                        <td width=\"50%\">Date on which the pupil actually left the school</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[left_date]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\">16.</td>\r\n                        <td width=\"50%\">The Pupil\'s conduct and Character</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[conduct]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\">17.</td>\r\n                        <td width=\"50%\">Date on which application for Transfer Certificate was made on behalf of the pupil by the Parent or Guardian</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[tc_made]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\" valign=\"top\">18.</td>\r\n                        <td width=\"50%\">Date of the Transfer Certificate</td>\r\n                        <td width=\"3%\">:</td>\r\n                        <td><span style=\"border-bottom: 1px solid #000000; width: 100%; display: inline-block;\">[tc_made2]</span></td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td width=\"3%\">19.</td>\r\n                        <td colspan=\"3\">Course of Study</td>\r\n                    </tr>\r\n                </table>\r\n            </td>            \r\n        </tr>        \r\n    </tbody>\r\n</table>\r\n<table style=\"border-collapse: collapse;margin: 0 auto; max-width: 750px; text-align: center; font-family: \'Arial\', Sans-serif;\" cellpadding=\"0\" width=\"100%\">\r\n    <tr>\r\n        <td width=\"36%\" style=\"border: 1px solid black\"><b>Name of the School</b></td>\r\n        <td width=\"16%\" style=\"border: 1px solid black\"><b>Academic<br/>Year(s)</b></td>\r\n        <td width=\"16%\" style=\"border: 1px solid black\"><b>Standard(s)<br/>Studied</b></td>\r\n        <td width=\"16%\" style=\"border: 1px solid black\"><b>First<br/>Language</b></td>\r\n        <td width=\"16%\" style=\"border: 1px solid black\"><b>Medium of<br/>Instruction</b></td>\r\n    </tr>\r\n    <tr>\r\n        <td rowspan=\"2\" style=\"border: 1px solid black\"><b>SRI SANKARA MATRIC. HR. SEC. SCHOOL<br/></b>Peralam-609 405, Nannilam Tk., <br/>Thiruvarur D.T.</td>\r\n        <td style=\"border: 1px solid black\">2018-2019</td>\r\n        <td style=\"border: 1px solid black\">[class]</td>\r\n        <td style=\"border: 1px solid black\">English</td>\r\n        <td style=\"border: 1px solid black\">English</td>\r\n    </tr>\r\n    <tr>\r\n        <td style=\"border: 1px solid black\">&nbsp;</td>\r\n        <td style=\"border: 1px solid black\">&nbsp;</td>\r\n        <td style=\"border: 1px solid black\">&nbsp;</td>\r\n        <td style=\"border: 1px solid black\">&nbsp;</td>\r\n    </tr>\r\n</table>\r\n<table style=\"max-width: 750px; font-family: \'Arial\', Sans-serif;\" cellpadding=\"0\" width=\"100%\">\r\n    <tr>\r\n        <td width=\"3%\">20. Signature of the Principal with Date and School Seal:</td>\r\n    </tr>\r\n    <tr>\r\n        <td>&nbsp;</td>\r\n    </tr>\r\n    <tr>\r\n        <td style=\" border-bottom: 1px solid #000000;\"><b>Declaration by the Parent or Guardian:</b><br/>I hereby declare that the particulars recorded against items 2 to 7<br/>are correct and no change will be demanded by me in the future.<br/><br/><br/>Signature of the Pupil<span style=\"padding-left: 100px;\">Signature of the Parent / Guardian</span></td>\r\n    </tr>\r\n</table>\r\n<table style=\"max-width: 750px; font-family: \'Arial\', Sans-serif;\" cellpadding=\"0\" width=\"100%\">\r\n    <tr>\r\n        <td width=\"5%\" valign=\"top\"><b>Note:</b></td>\r\n        <td>Erasures and unauthenticated or fraudulent alterations in the certificate will lead to its cancellation. Should be signed in ink by the Head of the Institution, who will be held responsible for the correctness of the entries.</td>\r\n    </tr>\r\n</table>', 1, '2019-03-22 06:23:24', 0, '2019-03-26 10:35:14', 0);
